In Liquip you can add a lore (the lines below the item's name) to your items. For this you need to create a new list with the name lore like so: { "lore": []
} You can put strings each representing a new line into this list. Each individual line - as the item's display name - supports MiniMessages . The default color of each line is purple. Here's an example of this: { "lore": [ "<blue>This is the first line", "This line is purple", "<italic>This line is italic" ]
}

16.body:
Adding enchantments to items will apply the given enchantments to this item by default. For example, you could add efficiency 10 to an item like this: { "enchantments": [ { "id": "minecraft:efficiency", "level": 10 } ]
} Each entry in this list is a new enchantment applied to the item. Adding unbreaking 4 to it would look like this: { "enchantments": [ { "id": "minecraft:efficiency", "level": 10 }, { "id": "minecraft:unbreaking", "level": 4 } ]
}

17.body:
A feature is a concept introduced by Liquip. It provides support for modifying items in other ways than just enchantments. Features may or may not be tagged. Untagged features have a value of null or true. Tagged features have a value of anything but null. Features are stored in an object called features like this one: { "features": {}
} For example, to make your item unbreakable you'd have to write this: { "features": { "minecraft:unbreakable": true }
} You could also use null inplace of true as the minecraft:unbreakable feature is untagged. An example of a tagged feature would be this: { "features": { "minecraft:dye_leather": "#00FFC0" }
} This would make your item - if it was made of leather - colored this specific color.
